DROP TABLE IF EXISTS `OHEM`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `OHEM` (
  `empID` int NOT NULL,
  `lastName` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `firstName` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `sex` char(1) COLLATE utf8mb4_general_ci DEFAULT 'M',
  `jobTitle` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `dept` smallint DEFAULT NULL,
  `branch` smallint DEFAULT NULL,
  `userId` int DEFAULT NULL,
  `mobile` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `email` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `UpdateDate` datetime DEFAULT NULL,
  `Active` char(1) COLLATE utf8mb4_general_ci DEFAULT 'Y',
  `CreateDate` datetime DEFAULT NULL,
  `Code` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `type_emp` enum('E','V') COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'E',
  `BiometricImage` longblob,
  PRIMARY KEY (`empID`),
  KEY `fk_OHEM_dept` (`dept`),
  KEY `fk_OHEM_branch` (`branch`),
  CONSTRAINT `fk_OHEM_branch` FOREIGN KEY (`branch`) REFERENCES `OUBR` (`Code`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_OHEM_dept` FOREIGN KEY (`dept`) REFERENCES `OUDP` (`Code`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
